import React, { useState, useEffect } from 'react';
import { View, Text, TouchableOpacity } from 'react-native';
import style from './style.js'

export default function Detalhe({ route }) {
    return (
        <View>
            <Text>Nome:</Text>
            <Text>Jogos:</Text>
            <Text>Time:</Text>
            <Text>Idade:</Text>
        </View>
    );
}
